import React, {Fragment} from 'react';


const DescricaoComLink = (props) => {
	return(
		<Fragment>
		<p>
			{props.descricao}
		</p>		
		<p>
			<a href={props.link} target="_blank"> Link para name={props.name}
			</a>
		</p>
		</Fragment>
	)
}

export default DescricaoComLink;
